INSERT INTO `modovi` VALUES (1,'/home/gamefiles/samp','mods.gb-hoster.me/Games/SAMP','SanAndreasMultiPlayer.zip','Default','Roleplay tip igre je simulacija pravog zivota. Ponasanje prema pravilima koja vaze i u pravome zivotu, strpljenje, druzenje, zabava, ali i obaveze koje trazi taj tip igre.','2','./samp03svr',0,'San Andreas','4.7168|0.04|2.462|0.2972|0.078','4.7168|0.04|2.462|0.2972|0.078'),(3,'/home/gamefiles/mc_1.7.9','mods.gb-hoster.me/Games/MC','MineCraft.zip','Minecraft 1.7/1.8','','3','java -d64 -Xincgc -Xms2048M -Xmx2048M -XX:MaxPermSize=128M -XX:+DisableExplicitGC -XX:+AggressiveOpts -Dfile.encoding=UTF-8 -jar spigot.jar',0,'world','7.0752|0.06|3.693|0.4458|0.117','7.0752|0.06|3.693|0.4458|0.117'),(4,'','','','Team Speak 3','Ts3 test','6','',0,'','7.0752|0.06|3.693|0.4458|0.117','7.0752|0.06|3.693|0.4458|0.117'),(5,'/home/gamefiles/cw','mods.gb-hoster.me/Games/CounterStrike','ClanWar.zip','ClanWar','ClanWar mod 2018 (AntiExploit + HLDS Shield + VAC or NO Vac Secure)','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'de_dust2','44.22|0.375|23.08125|2.78625|0.73125','47.168|0.4|24.62|2.972|0.78'),(6,'','mods.gb-hoster.me/Games/FastDL','FastDL.zip','FastDL','FastDL','7','',0,'','235.84|2|123.1|14.86|3.9','235.84|2|123.1|14.86|3.9'),(7,'','','','Sinus Bot','','8','',0,'','235.84|2|123.1|14.86|3.9','235.84|2|123.1|14.86|3.9'),(8,'/home/gamefiles/dm','mods.gb-hoster.me/Games/CounterStrike','DeathMatch.zip','DeathMatch','Ovo je mod koji obozava vecina igraca, na njemu ucite da se snalazite u prostoru, dobijate na brzini i preciznosti, jer svaki metak Vam znaci. Igra se tako sto se stvarate randomirano po mapi odmah nakon smrti, brzo odabirete zeljeno oruzije i ubijate protivnike. ','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'de_dust2','44.22|0.375|23.08125|2.78625|0.73125','47.168|0.4|24.62|2.972|0.78'),(2,'','mods.gb-hoster.me/Games/CounterStrike','Public.zip','Public [ReHLDS]','Normalna igra CS1.6, tim Terorista(T) protiv tima Counter-Terorista(CT). Misija CT tima je da sacuva ciljeve T tima, te da ih sve eliminira ili do kraja runde zadrzi plant-ove sigurnima. T tim mora da se probije do plantova koje cuva CT tim, da ih eliminira ili da postavi C4 te ga cuva do njegovog unistenja.','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'de_dust2','44.22|0.375|23.08125|2.78625|0.73125','47.168|0.4|24.62|2.972|0.78'),(9,'','mods.gb-hoster.me/Games/CounterStrike','Public_HLDS.zip','Public [HLDS + AntiExploit 2018 NEW]','Normalna igra CS1.6, tim Terorista(T) protiv tima Counter-Terorista(CT). Misija CT tima je da sacuva ciljeve T tima, te da ih sve eliminira ili do kraja runde zadrzi plant-ove sigurnima. T tim mora da se probije do plantova koje cuva CT tim, da ih eliminira ili da postavi C4 te ga cuva do njegovog unistenja.','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'de_dust2','44.22|0.375|23.08125|2.78625|0.73125','47.168|0.4|24.62|2.972|0.78'),(10,'','mods.gb-hoster.me/Games/CounterStrike','DeathRun.zip','DeathRun MOD','DeathRun Mod ima specijalne mape sa raznim preprekama. \r\nJedan ili vise igraca imaju ulogu da aktviraju te prepreke dok ostali pokusavaju da prodju mapu izbegavajuci te prepreke.','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'deathrun_arctic','44.22|0.375|23.08125|2.78625|0.73125','47.168|0.4|24.62|2.972|0.78'),(11,'','mods.gb-hoster.me/Games/CounterStrike','JailBreak.zip','Jailbreak MOD','JailBreak mod ima dva tima, Zastitari(CT) i Robijasi(T), zastitari drze zatvor pod kontrolom, pustaju robijase van i naredjuju im, svako ko ne izvrsi naredjenje bude ubijen, takodjer, robijasi nekad imaju i free day(slobodan dan), kada mogu ici gde zele po mapi osim u GR (gun room, soba sa oruzijem)...','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'jail_xmf','44.22|0.375|23.08125|2.78625|0.73125','47.168|0.4|24.62|2.972|0.78'),(12,'','mods.gb-hoster.me/Games/CounterStrike','Knife.zip','Knife Maps MOD','Knife Maps Mod ima specijalne male mape i ovde se igraci susrecu 1 na 1 samo sa nozem','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'35hp_alone','44.22|0.375|23.08125|2.78625|0.73125','47.168|0.4|24.62|2.972|0.78'),(13,'','mods.gb-hoster.me/Games/CounterStrike','CodMw4.zip','COD MOD','COD Mod je standardan CS ali sa zvukovima i oruzjem iz igre Call of Duty','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'de_dust2','44.22|0.375|23.08125|2.78625|0.73125','47.168|0.4|24.62|2.972|0.78'),(14,'','mods.gb-hoster.me/Games/CounterStrike','BaseBuilder.zip','BaseBuilder Zombie 6.5','Ovaj mod transformise tim CT u Survivors koji na pocetku runde prave bazu tako sto pomeraju objekte uz pomocu &quot;use&quot; tastera, Terori postaju zombiji koji cekaju da se zavrsi deo za gradnju nakon cega sledi deo gde zombiji proveravaju protivnicku bazu za rupe i na kraju battle mod gde zombiji upadaju u bazu protivnika i koji tim zavrsi sa prezivelima pobedio je. NAPOMENA: Obavezno kod instalacije moda povecajte mp_roundtime u server.cfg','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'bb_classic11','44.22|0.375|23.08125|2.78625|0.73125','47.168|0.4|24.62|2.972|0.78'),(15,'','mods.gb-hoster.me/Games/CounterStrike','Furien.zip','Furien Mod','Furien Mod je mod gde su Terori Furieni, oni nemaju oruzje, samo bombe i noz, visoko skacu i brzi su, CT su anti furieni i imaju oruzje ali Deagle. Ako anti furien ubije Furiena onda on postaje Furien. Zanimljiv gameplay ;)','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'de_dust2','44.22|0.375|23.08125|2.78625|0.73125','47.168|0.4|24.62|2.972|0.78'),(16,'','mods.gb-hoster.me/Games/CounterStrike','PaintBall.zip','Paintball MOD','Paintball Mod ima specijalne mape i specijalna oruzja koja umesto metaka ispaljuje obojene loptice.','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'de_dust2','44.22|0.375|23.08125|2.78625|0.73125','47.168|0.4|24.62|2.972|0.78'),(17,'','mods.gb-hoster.me/Games/CounterStrike','Zmurka.zip','Zmurka MOD','Zmurka Mod ima zatamljene mape, mrak je, jedan deo tima ima zadatak da se sakrije po mapi dok drugi ih traze u mraku','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'de_dust2','44.22|0.375|23.08125|2.78625|0.73125','47.168|0.4|24.62|2.972|0.78'),(18,'','mods.gb-hoster.me/Games/CounterStrike','GunGame.zip','GunGame MOD','Svakim ubistvom sakupljate poene, kada nakupite dovoljan broj za sledeci level, automatski dobijate jace oruzije. \r\nCim umrete ozivljavate se kao na deathmatch modu.','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'gg_33_arena','44.22|0.375|23.08125|2.78625|0.73125','47.168|0.4|24.62|2.972|0.78'),(19,'','mods.gb-hoster.me/Games/CounterStrike','ZombiePlague.zip','Zombie Plague','Counteri i terori zajednickim snagama i taktikom igraju protiv zombija, koji samo ako dotaknu ljude pretvaraju ih u zombije koji se bore na njihovoj strani.','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'zm_five','44.22|0.375|23.08125|2.78625|0.73125','47.168|0.4|24.62|2.972|0.78'),(20,'','mods.gb-hoster.me/Games/CounterStrike','AutoMix.zip','AutoMix MOD','AutoMix je mod koji sam mixa igrace, jednostavno udjes i igras','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'de_dust2','44.22|0.375|23.08125|2.78625|0.73125','47.168|0.4|24.62|2.972|0.78'),(21,'','mods.gb-hoster.me/Games/CounterStrike','Surf.zip','Surf MOD','Surf Mod ima specijalne mape po kojima igraci klize kao da surfuju. \r\nCilj je preci sve delove mape i doci do kraja a ne pasti sa staza po kojima se klizi.','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'surf_strange2','44.22|0.375|23.08125|2.78625|0.73125','47.168|0.4|24.62|2.972|0.78'),(22,'','mods.gb-hoster.me/Games/CounterStrike','AWP.zip','AWP Maps MOD','AWP Maps Mod ima specijalne male mape i u ovom modu se koristi samo AWP sniper','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'awp_city','44.22|0.375|23.08125|2.78625|0.73125','47.168|0.4|24.62|2.972|0.78'),(23,'','mods.gb-hoster.me/Games/CounterStrike','Predator.zip','Predator Mod','Ovaj mod ubacuje u igru mogucnost da igraci koji imaju 16000$ kupe predatora i da tako love ostale igrace po mapi. Na raspolaganju su im kandze i jednim udarcem ubijaju igraca, mogu da iskoriste 3 plazma pucanja i takodje nevidljivost. Kada predatora neko ubije onda se vraca kao obican igrac. ||| \r\nClient komande: bind mouse3 ppfire (puca plazmu) ||| bind p pcview (menja pogled) ||| dbinds (binduje ove komande automatski) ||| say /predatorhelp (pomoc)','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'avp_alien_attack','44.22|0.375|23.08125|2.78625|0.73125','47.168|0.4|24.62|2.972|0.78'),(24,'','mods.gb-hoster.me/Games/CounterStrike','Biohazard.zip','Biohazard MOD','Counteri i terori zajednickim snagama i taktikom igraju protiv zombija, koji samo ako dotaknu ljude pretvaraju ih u zombije koji se bore na njihovoj strani.','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'zm_train_beta3','44.22|0.375|23.08125|2.78625|0.73125','47.168|0.4|24.62|2.972|0.78'),(25,'','mods.gb-hoster.me/Games/CounterStrike','Ctf.zip','Capture The Flag (CTF)','Ovaj mod menja gameplay tako da u svakoj bazi postoji zastava i svaki tim treba da ode u protivnicku bazu, uzme zastavu i uspesno je odnese u svoju bazu i tako dobije poen. Takodje svaki tim treba da cuva svoju zastavu.','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'de_dust2','44.22|0.375|23.08125|2.78625|0.73125','47.168|0.4|24.62|2.972|0.78'),(26,'','mods.gb-hoster.me/Games/CounterStrike','Kreedz.zip','KreedZ MOD','KreedZ KZ Mod ima specijalne mape gde se testira vestinja skakanja. Cilj je preci celu mapu i preskociti od platforme do platforme bez padanja i promasaja.','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'kz_hop','44.22|0.375|23.08125|2.78625|0.73125','47.168|0.4|24.62|2.972|0.78'),(27,'','mods.gb-hoster.me/Games/CounterStrike','Hns.zip','Hide n Seek MOD','Hide\'n\'Seek Mod ima specijalne mape po kojima se skace i penje. \r\nNa pocetku runde jedan tim ima odredjeno vreme da pobegne sto dalje dok ih posle drugi tim trazi po mapi.','1','./hlds_run -game cstrike +ip {$ip} +port {$port} +maxplayers {$slots} +sys_ticrate 300 +map {$map} +servercfgfile server.cfg',0,'hns_dust','44.22|0.375|23.08125|2.78625|0.73125','47.168|0.4|24.62|2.972|0.78');
