INSERT INTO `plugins` VALUES (2,'Admin Push','Omogucava adminu da gura igrace koji mu stoje na putu. Podesavanja: amx_adminpushlevel xx //default 25 - jacina push-a *podesavanje se vec nalazi u cstrike/addons/amxmodx/configs/amxx.cfg','plugins-adminpush.ini','amx_adminpush.amxx'),(3,'AFK Manager','Izbacuje sa servera igrace koji nisu za kompom da ne zauzimaju slot.','plugins-afkkicker.ini','afkkicker2.amxx'),(4,'AMX Super','Set raznih admin kazni i komandi (glow, rocket, transfer, bury itd)','plugins-amxsuper.ini','amx_super-cmdmanager.amxx\r\namx_super-fun.amxx\r\namx_super-menu.amxx\r\namx_super-others.amxx\r\n;amx_super-serious.amxx'),(5,'Anti Scroll Plugin','Plugin protiv skrolanja na serveru.','plugins-antiscroll.ini','anti_dd_scroll.amxx'),(7,'Auto Bunny Hop Menu','Pri ulasku na server, plugin pokazuje igracu meni sa izborom da li da ukljuci bunny hop ili ne Cvarovi: u amxx.cfg bhop_auto 1 bhop style 1','plugins-autobhop.ini','auto_bunny_hop__menu.amxx'),(8,'Auto Reload Admins','Ovaj plugin je dobar za servere koji imaju klase ili slotove, ne morate kucati amx_reloadadmins ili menjati mapu,ovaj plugin to radi automatski samo u amxx.cfg dodajte cvar reload_time 60.0 (default je 10.0 sekundi)','plugins-reloadadmins.ini','autoreloadadmins.amxx'),(9,'Bad Camper 4','Kaznjava igrace koji se stekaju po mapama.','plugins-camper.ini','bad_camper.amxx'),(10,'Boost','Upustvo za boostovanje servera.','plugins-boost.ini','boost.amxx'),(12,'ESP Anticheat','Admin kada je &quot;dead&quot; pojavljuju mu se pravougaonici na mestima gde su igraci sa druge strane zidova i tako moze da prati da li igrac pogadja druge tacno kroz zid','plugins-esp.ini','admin_spec_esp.amxx'),(13,'Frag Counter','Brojac fragova na levoj strani ekrana','plugins-frags.ini','fragcounter.amxx'),(14,'Gag Plugin','Plugin koji gaguje igracev chat Cvars amx_defaut_gag_time &quot;20&quot; - gag time when entered just amx_gag &lt;name or #userid&gt; amx_gag_by_authid &quot;1&quot; - if set to positive number gags are by authid (good for steam server, else i recommend you to use value &quot;0&quot;) Komanda za admine amx_gag','plugins-gag.ini','admin_gag__meni.amxx'),(15,'Galileo Votemap Plugin','Votemap plugin Sva podesavanja su u cstrike/addons/amxmodx/configs/galileo/','plugins-galileo.ini','galileo.amxx'),(17,'High Ping Kicker','Kikuje igrace koji imaju previsok ping. Podesavanja su u cstrike/addons/amxmodx/configs/amxx.cfg','plugins-hpk.ini','high_ping_kicker.amxx'),(18,'Hostage Punish','Kaznjava igrace koji ubijaju taoce Auto sets mp_hostagepenalty to 0 Cvars:: sv_host_limit = How Many Hostage Kills Are Legal to kill (def=4) sv_host_ban = If they reach Limit will there be a vote to Ban Them (def=0) sv_host_kick = If they reach Limit will there be a vote to Ban Them (def=1) sv_host_slay = If they reach Limit will They be Autoslain (def=1) sv_host_slap = If they attack a hostage they get slapped with &quot;sv_host_slappower&quot; dmg (def=1) sv_host_slappower = Power of the &quot;sv_host_slap&quot; (def=2)','plugins-hostage.ini','hostage_protection.amxx'),(19,'Bots','Dodaje 2 bota da budu reklama na serveru u spectatoru. Podesavanja u cstrike/addons/amxmodx/configs/bots.cfg','plugins-botovi.ini','bots.amxx'),(20,'Last Man Bets','Kada na kraju runde ostanu dva igraca 1 na 1, ostali igraci koji ih posmatraju mogu da se klade na jednog od te dvojice.','plugins-bet.ini','lastmanbets.amxx'),(21,'Mapend Sounds','Muzika na kraju mape \r\nNAPOMENA: Kada instaliras ovaj plugin podesi sv_chattime na 12 u cstrike/server.cfg','plugins-mapendsounds.ini','mapend_sounds.amxx'),(22,'No retry','Plugin koji zabranjuje recconect na server \r\n\r\nDodati u amxx.cfg po zelji od servera do servera \r\nCVARS : \r\namx_retrytime	- time in seconds to determine if retry was used ( default: 60 ) \r\namx_retrykick	- set to 1 if you want to kick retry users ( default: 0 ) \r\namx_retryshow	- set to 0 if you want to disable public announces about use of retry ( default: 0 ) \r\namx_retrychat	- show usage in playerchat ( default: 1 ) \r\namx_retrymsg	- message which is displayed after reconnect to user ( default: &quot;No retry allowed here, %s&quot; ) * \r\namx_retrykickmsg - reason when kicked ( default: &quot;DO NOT USE RETRY COMMAND&quot; ) \r\namx_retrychatmsg - message in playerchat ( default: &quot;%s was kicked: reconnect in %t seconds&quot; ) * \r\n\r\n* NOTE: \r\n\r\n%s = players name \r\n%t = same as in amx_retrytime','plugins-noretry.ini','no_retry.amxx'),(23,'Ping Faker','Ako imas Lite server i zelis da ti se na TAB ispisuje manji ping ovaj plugin ce to smanjiti!\r\nPodesavanja se nalaze u /cstrike/addons/amxmodx/configs/amxx.cfg','plugins-pingfaker.ini','pingfaker.amxx'),(24,'Prevmaps','Prikazuje prethodne mape','plugins-prevmap.ini','prevmap.amxx'),(25,'PTB Balancer','Pravi balans u timovima. \r\n\r\nPodesavanja se nalaze u fajlu: \r\ncstrike/addons/amxmodx/configs/ptb.cfg ','plugins-ptb.ini','ptb.amxx'),(26,'Public Rules','Ispisuje pravila posle odabira tima. \r\n\r\nTekst pravima moze se menjati u fajlu: \r\ncstrike/rules.txt','plugins-rules.ini','public_rules.amxx'),(27,'Restrict Names','Zabranjuje odredjene nickove kao i one predugacke ili prekratke. \r\n\r\nNick u koji se menja prestupnik podesava se u fajlu: \r\ncstrike/addons/amxmodx/configs/amxx.cfg \r\n\r\nKomanda: \r\nrestnames_default_name &quot;&quot; \r\n','plugins-restrict.ini','restrictnames.amxx'),(28,'Slay Losers','Gubitnicki tim na kraju runde dobija slay','plugins-slay.ini','Slaylosers_lite.amxx debug'),(30,'Team Semi Clip','Prolazenje kroz timske igrace \r\n\r\nDodati u amxx.cfg \r\n\r\n///CS team semiclip \r\nsemiclip 1 \r\nsemiclip_blockteam 0 \r\nsemiclip_enemies 0 \r\nsemiclip_unstuck 0 \r\nsemiclip_button 0 \r\nsemiclip_knife_trace 0 \r\nsemiclip_duration 0 \r\nsemiclip_render 0 \r\nsemiclip_color_admin_flag &quot;g&quot;','plugins-semiclip.ini','kgb_semiclip.amxx'),(32,'Ultimate Sounds Female','Razni zvukovi u toku runde, na kraju i pocetku, ali zenski','plugins-female.ini','Ultimate_sounds_female.amxx'),(33,'Ultimate Sounds Original','Razni zvukovi, tokom runde, na pocetku i kraju runde.','plugins-sounds.ini','ultimate_sounds.amxx'),(34,'Xredirect','Ovaj plugin slu≈æi za redirektovanje igraƒça sa ovoga na drugi ≈æeljeni server. Vi≈°e info o pode≈°avanju: http://pastebin.com/gAWe4xwj','plugins-xredi.ini','xredirect_new.amxx'),(35,'Walkguard','Sadrzi stek zone koje kaznjavaju igrace koji se previse vremena zadrze u tim zonama. \r\n\r\nZone se prave ili menjaju iz menija koji se dobije komandom: \r\nwalkguardmenu ','plugins-walkguard.ini','walkguard.amxx'),(36,'Antispam','Plugin protiv reklamiranja na serveru','plugins-antispam.ini','antispam.amxx'),(37,'Infotop','Plugin uzima sve informacije sam, nije potrebno ubacivanje cvarova niti bilo kakvo podesavanje.Jedino sto treba da uradite je da promenite prefiks [Ime Servera] komandom amx_prefix &quot;Zeljeni Text&quot;.Plugin prigazuje ukupan broj rundi i trenunto odigranih rundi, trenunto mapu i next map, broj slotova i online igraca.','plugins-infotop.ini','infotop.amxx'),(38,'ATAC 2.5.5.5','Kaznjava team killere. \r\nSva podesavanja nalaze se u fajlu: \r\ncstrike/addons/amxmodx/configs/atac/atac.cfg','plugins-atac.ini','atac.2.5.5.5.amxx'),(39,'Anti Reklama','Ovaj plugin onemoguƒáava reklamiranje drugih servera/zajednica/odredjenih stvari. Dodatno: Komande su antireklama_status &lt;1/0&gt; Ukljuci/Iskljuci antireklama_kazna &lt;1:6&gt; po defaultu je: 1 (bez kazne) antireklama_prefix &quot;Ime servera&quot;. SAY KOMANDA /antireklama (pristup ima samo admin sa rcon flagom)','plugins-antireklama.ini','anti_reklama.amxx'),(40,'Radio','Ovaj plugin omoguƒáuje igraƒçima slu≈°anje LIVE radio stanica u toku igre, Dodatno: Komanda say /radio','plugins-radio.ini','hlmp.amxx'),(41,'ScreenShot Player','Ovaj plugin omoguƒáava adminima da urade SS na odredjenom igracu i uslikaju mu njegovu igru prije bana, tako da ukoliko igraƒç nije cheater ili sliƒçno, mo≈æe sa time da doka≈æe da nije kriv. Komanda amx_ss','plugins-ss.ini','ultimate_ss.amxx'),(42,'Demo Recorder','Ovaj plugin svakome igraƒçu koji se konektuje krene snimati demo i po njegovu iskljuƒçenju mu spremi taj demo u &quot;cstrike&quot; folder. U amxx.cfg koji se nalazi u cstrike/addons/amxmodx/configs folderu dodati sljedece cvarove: amx_demo 1 -Ukljucuje rekorder amx_demo_mode 0 amx_demo_rectime 60 Odredjuje kolko minuta ce biti sniman demo. amx_demo_name &quot;Ime demo-a&quot; amx_demo_prefix &quot;Automatski demo se snima.&quot;','plugins-demo.ini','amx_demorecorder.amxx'),(43,'Amx Log','Plugin namjenjen za lakse upisivanje klasa i slotova, plugin pravi log.txt u /cstrike/addons/amxmodx/configs gde smesta sve konektovane STEAM ID-ove sa detaljima. \r\n\r\nPrimjer: \r\nPlayer: Spirit IP: 213.221.239.244:27005 SteamID: STEAM_0:1:36234311 Date: 01.05.2015 -- 16:58:12','plugins-log.ini','amx_log_advanced.amxx'),(44,'Clock Maker','Mogucnost da se prave satovi po zidovima mapa. \r\nPodesavanja: \r\ncm_hourtype 1 //(0: 12 hour clocks, 1: 24 hour clocks) \r\ncm_hourannounce 0 //(hear the hour spoken on the hour) \r\ncm_timeoffset +1 //(offset the time to a different timezone +/- hours)','plugins-clock.ini','clockmaker_v1.1.amxx'),(45,'Headshot Only','Ovaj plugin ukljucuje Headshot only mode gde protivnika mozete ubiti samo pogotkom u glavu','plugins-hs.ini','hs_mode.amxx');
