INSERT INTO `tiketi_odgovori` VALUES (4,2,NULL,3,'Pozz<br />\nDobija se samo ako kupite server.','1539011353'),(5,3,20,NULL,'MOZETEL MI DIGANT MHSIC BOTA UNAPRED SE ZAHVALJUJEM','1539100074'),(2,1,NULL,3,'Pozz<br />\nDobija se, recite mi samo ime vaseg servera na panelu<br />\n','1538932431'),(3,2,5,NULL,'Da li se FDL dobija gratis za 32 slota i ako se dobija da li mogu dobiti? Hvala unapred :D','1538982845'),(6,3,NULL,2,'Postovani, mozemo, music bot kosta 2eura :)','1539105189'),(7,3,NULL,2,'Reseno :)','1539118499'),(8,4,50,NULL,'<m>Podatke koje je klijent popunio:</m><br />\n					Iznos uplate: <m>1233434 din (10399.95 &euro;)</m><br />\n					Ime uplatioca: <m>Bojan</m><br />\n					Datum uplate: <m>sdfsdfds\'</m><br />\n					Broj racuna: <m>234234324324</m><br />\n					Drzava: <m>srb</m><br /><br />\n\n					Linkovi uplatnica:<br />\n					<m>www.google.com</m>','1540072595'),(9,5,50,NULL,'Pozdrav!<br />\n					Trebate mi podici Team Speak 3 Server<br>\n					Slotovi : 500','1540117978'),(10,5,NULL,6,'Pozdrav, da li si platio?','1540118206'),(11,6,50,NULL,'Pozdrav!<br />\n					Trebate mi podici 1 Sinus Bot-a/ova<br>','1540119254'),(12,7,50,NULL,'Pozdrav!<br />\n					Trebate mi podici Team Speak 3 Server<br>\n					Slotovi : 50','1540120012'),(13,7,NULL,2,'To ce vas kostato 1,219,700,19dinara','1540123191'),(27,11,NULL,6,'Sacekajte momenat.','1542562413'),(15,8,NULL,6,'Pozdrav, da li ste sigurni da ste sve uradili kako treba?<br />\n<br />\ndodali link u server.cfg?<br />\n<br />\nda li imate cstrike file kada udjete na filezilu pa na fdl se povezete?<br />\n<br />\nukoliko nije nista od ovoga u najkracem mogucem roku sredicemo problem :)','1540134141'),(17,8,NULL,6,'Molicu da sacekate :)','1540134363'),(26,11,89,NULL,'napravio sam na fdl novi folder vostajb jer ga delim sa Stefan V Pisarov.<br />\nUpisao sam link fdl i zamenio cstrike sa mojim imenom foldera na fdl.<br />\nFDL je radio juce i danas.  Ali pre 20 min je prestao da radi i modeli se skidaju dugo i mape.<br />\nHelp.','1542562277'),(20,8,NULL,3,'Pozdrav!<br />\nPosaljite nam IP servera na kom je FDL.<br />\nTestirao sam FDL sada i odlicno radi.','1540139835'),(21,9,46,NULL,'Server mi stopira pomognite plz zato sto imamm boostove a koci srw,Hvala unaored','1540331353'),(22,9,NULL,6,'Izvinite sto ste cekali na odgovor, ako vam se idalje bude desavalo otvorite opet tiket :) ','1540357582'),(23,9,NULL,4,'Po≈°tovani,<br />\n<br />\nServer sam detaljno pregledao, uzrok pada servera cinilo je nekoliko plugina tacnije amx_super i anticheat_binds. Naime anticheat_binds plugin se vec sastoji u pluginu mdb_bans_system i to je glavni uzrok pada servera. Popravio sam to i ne ubacujte vise te plugine. Dodao sam Vam fdl i ubacio tako da Vam se igraci brze connect na server.. Dodao sam vip plugin za jb i par korisnih plugina. Ukoliko Vam treba jos nesto otvorite support ticket.<br />\n<br />\nPozdrav,<br />\nVas www.gb-hoster.me','1540420077'),(24,10,79,NULL,'Ubacio sam VIP plugin i plugin radi lepo bez bagova, jedina greska je sto pise ML_NOTFOUND u menu, ubacio sam u lang folderu vip.txt i ne radi. Da li bite mogli da odgonetnetne zasto nece ?<br />\n','1542240014'),(25,10,NULL,4,'Pozdrav,<br />\n<br />\nKoji taƒçno ste plugin ubacili, mo≈æete li poslati link plugina odakle ste preuzeli da pogledam...<br />\n<br />\n<br />\n','1542287199'),(28,11,89,NULL,'Uredu <img src=\"./assets/smajli/001.png\" />','1542562577'),(29,11,NULL,3,'Popravljeno je :D','1542566986'),(242,123,NULL,1,'reseno je....mi vidimo sve sta pise..','1551514975'),(31,12,101,NULL,'Test test 20 karaktera','1543355276'),(32,12,NULL,11,'Test','1543355299'),(33,13,47,NULL,'Evo vam tiket na mail, aj vidite da li radi :D','1543588447'),(34,14,47,NULL,'Opet test tiket breee','1543588717'),(35,15,47,NULL,'Opet test tiket breee sgagasga asgasfasdfad','1543588816'),(241,123,185,NULL,'Kada reinstaliram server i udjem u server.cfg prazan je?','1551463790'),(37,17,8,NULL,'Pozdravljam,ako ima iko aktivan da mi skine za≈°titu sa s